B.a2_=s(["Heat the grill to high. Arrange the bacon on a baking tray lined with foil. Cook for 5-7 mins until crisp, then turn off the grill but leave the tray inside to keep warm.","In a bowl, mix the flour, baking powder and sugar with a pinch of salt. Make a well in the centre and add the mashed banana, eggs, butter and milk. Whisk to a smooth batter.","Heat a little butter in a large frying pan. Ladle in small dollops of the batter, leaving a little space between each. Put 2 or 3 slices of banana onto each pancake and cook for 2 mins over a medium heat.","When you see bubbles appear, flip the pancakes over and cook for 1 min more, until puffed up and golden.","Serve the pancakes with the crispy bacon and a drizzle of maple syrup."],t.s)
B.a2d=s(["\u0633\u062e\u0651\u0646 \u0627\u0644\u0634\u0648\u0627\u064a\u0629 \u0639\u0644\u0649 \u062f\u0631\u062c\u0629 \u0639\u0627\u0644\u064a\u0629. \u0631\u062a\u0651\u0628 \u0627\u0644\u0644\u062d\u0645 \u0627\u0644\u0645\u0642\u062f\u062f \u0639\u0644\u0649 \u0635\u064a\u0646\u064a\u0629 \u0645\u0628\u0637\u0646\u0629 \u0628\u0648\u0631\u0642 \u0627\u0644\u0642\u0635\u062f\u064a\u0631. \u0627\u0637\u0647\u0650 \u0644\u0645\u062f\u0629 5-7 \u062f\u0642\u0627\u0626\u0642 \u062d\u062a\u0649 \u064a\u0635\u0628\u062d \u0645\u0642\u0631\u0645\u0634\u0627\u064b.","\u0641\u064a \u0648\u0639\u0627\u0621\u060c \u0627\u062e\u0644\u0637 \u0627\u0644\u0637\u062d\u064a\u0646 \u0648\u0627\u0644\u0628\u064a\u0643\u0646\u063a \u0628\u0627\u0648\u062f\u0631 \u0648\u0627\u0644\u0633\u0643\u0631 \u0645\u0639 \u0631\u0634\u0629 \u0645\u0644\u062d. \u0623\u0636\u0641 \u0627\u0644\u0645\u0648\u0632 \u0627\u0644\u0645\u0647\u0631\u0648\u0633 \u0648\u0627\u0644\u0628\u064a\u0636 \u0648\u0627\u0644\u0632\u0628\u062f\u0629 \u0648\u0627\u0644\u062d\u0644\u064a\u0628. \u0627\u062e\u0641\u0642 \u062d\u062a\u0649 \u064a\u0635\u0628\u062d \u0627\u0644\u062e\u0644\u064a\u0637 \u0646\u0627\u0639\u0645\u0627\u064b.","\u0633\u062e\u0651\u0646 \u0627\u0644\u0642\u0644\u064a\u0644 \u0645\u0646 \u0627\u0644\u0632\u0628\u062f\u0629 \u0641\u064a \u0645\u0642\u0644\u0627\u0629 \u0643\u0628\u064a\u0631\u0629. \u0627\u0633\u0643\u0628 \u0645\u0644\u0627\u0639\u0642 \u0635\u063a\u064a\u0631\u0629 \u0645\u0646 \u0627\u0644\u062e\u0644\u064a\u0637 \u0645\u0639 \u062a\u0631\u0643 \u0645\u0633\u0627\u0641\u0629 \u0628\u064a\u0646\u0647\u0627. \u0636\u0639 \u0634\u0631\u0627\u0626\u062d \u0627\u0644\u0645\u0648\u0632 \u0641\u0648\u0642 \u0643\u0644 \u0648\u0627\u062d\u062f\u0629 \u0648\u0627\u0637\u0647\u0650 \u0644\u0645\u062f\u0629 \u062f\u0642\u064a\u0642\u062a\u064a\u0646.","\u0639\u0646\u062f\u0645\u0627 \u062a\u0631\u0649 \u0641\u0642\u0627\u0639\u0627\u062a\u060c \u0627\u0642\u0644\u0628 \u0627\u0644\u0628\u0627\u0646 \u0643\u064a\u0643 \u0648\u0627\u0637\u0647\u0650 \u0644\u0645\u062f\u0629 \u062f\u0642\u064a\u0642\u0629 \u0625\u0636\u0627\u0641\u064a\u0629.","\u0642\u062f\u0651\u0645 \u0627\u0644\u0628\u0627\u0646 \u0643\u064a\u0643 \u0645\u0639 \u0627\u0644\u0644\u062d\u0645 \u0627\u0644\u0645\u0642\u062f\u062f \u0627\u0644\u0645\u0642\u0631\u0645\u0634 \u0648\u0631\u0630\u0627\u0630 \u0645\u0646 \u0634\u0631\u0627\u0628 \u0627\u0644\u0642\u064a\u0642\u0628."],t.s)
