B.a2n=s(["Heat a large saucepan and dry-fry 2 tsp cumin seeds and a pinch of chilli flakes for 1 min, or until they start to jump around the pan and release their aromas.","Scoop out about half with a spoon and set aside. Add olive oil, coarsely grated carrots, split red lentils, hot vegetable stock and milk to the pan and bring to the boil.","Simmer for 15 mins until the lentils have swollen and softened.","Whizz the soup with a stick blender or in a food processor until smooth.","Season to taste and finish with a dollop of plain yogurt and a sprinkling of the reserved toasted spices. Serve with warmed naan breads."],t.s)
