B.a2G=s(["Get chilled ingredients out of the fridge and let them come to room temperature.","Preheat oven to 220\xb0C. Line a 25cm springform cake tin with greaseproof paper, scrunching it into all the corners.","Beat cream cheese, sugar and a pinch of salt in a stand mixer on medium-low speed for 2 minutes.","With the whisk spinning on low, crack in eggs one at a time, mixing well before adding the next. Pour in cream and beat for 1 minute.","Sift in the flour and gently fold in using a spatula.","Tip into the tin and bake for 45 minutes, until golden on top with a slight wobble in the middle. Cool completely.","Chill for a couple of hours or ideally overnight before serving."],t.s)
