B.a8m=new A.c(B.ax,["Spaghetti Bolognese","This easy version of a classic Italian recipe will help everyone get their 5 A Day.",431,30,70,7,15,"Easy","Dinner",4,0,1,"NHS","https://assets.nhs.uk/campaigns-cms-prod/images/24.-Spaghetti-bolognese.width-1534.jpg","https://www.nhs.uk/healthier-families/recipes/easy-spaghetti-bolognese/",B.a2I,"\u0633\u0628\u0627\u063a\u064a\u062a\u064a \u0628\u0648\u0644\u0648\u0646\u064a\u0632","\u0646\u0633\u062e\u0629 \u0633\u0647\u0644\u0629 \u0645\u0646 \u0648\u0635\u0641\u0629 \u0625\u064a\u0637\u0627\u0644\u064a\u0629 \u0643\u0644\u0627\u0633\u064a\u0643\u064a\u0629 \u0633\u062a\u0633\u0627\u0639\u062f \u0627\u0644\u062c\u0645\u064a\u0639 \u0639\u0644\u0649 \u0627\u0644\u062d\u0635\u0648\u0644 \u0639\u0644\u0649 \u062d\u0635\u062a\u0647\u0645 \u0627\u0644\u064a\u0648\u0645\u064a\u0629 \u0645\u0646 \u0627\u0644\u062e\u0636\u0627\u0631.",B.a3m],t.R)
B.a5m=s(["Heat oil in a non-stick pan on high heat. Add chicken and cook for 2 minutes. Add cumin, turmeric, chilli powder and salt. Fry on medium heat for 3-4 mins.","Remove the chicken and set aside. Fry sliced onions on medium heat for 7 minutes until soft and golden.","Add ginger, garlic and peppers, cook for 2 minutes. Add blended tomatoes and cook for 2 more minutes.","Stir in coriander powder, garam masala and cumin seeds. Add chicken back, stir well and cook for a couple of minutes.","Add green chillies and water, cover and simmer on low heat for 10-15 minutes until tender. Scatter over chopped coriander."],t.s)
B.a36=s(["\u0633\u062e\u0651\u0646 \u0627\u0644\u0632\u064a\u062a \u0641\u064a \u0645\u0642\u0644\u0627\u0629 \u063a\u064a\u0631 \u0644\u0627\u0635\u0642\u0629 \u0639\u0644\u0649 \u0646\u0627\u0631 \u0639\u0627\u0644\u064a\u0629. \u0623\u0636\u0641 \u0627\u0644\u062f\u062c\u0627\u062c \u0648\u0627\u0637\u0647\u0650 \u0644\u0645\u062f\u0629 \u062f\u0642\u064a\u0642\u062a\u064a\u0646. \u0623\u0636\u0641 \u0627\u0644\u0643\u0645\u0648\u0646 \u0648\u0627\u0644\u0643\u0631\u0643\u0645 \u0648\u0627\u0644\u0641\u0644\u0641\u0644 \u0627\u0644\u062d\u0627\u0631 \u0648\u0627\u0644\u0645\u0644\u062d. \u062d\u0645\u0651\u0631 \u0644\u0645\u062f\u0629 3-4 \u062f\u0642\u0627\u0626\u0642.","\u0623\u062e\u0631\u062c \u0627\u0644\u062f\u062c\u0627\u062c \u0648\u0627\u062d\u062a\u0641\u0638 \u0628\u0647 \u062c\u0627\u0646\u0628\u0627\u064b. \u062d\u0645\u0651\u0631 \u0634\u0631\u0627\u0626\u062d \u0627\u0644\u0628\u0635\u0644 \u0639\u0644\u0649 \u0646\u0627\u0631 \u0645\u062a\u0648\u0633\u0637\u0629 \u0644\u0645\u062f\u0629 7 \u062f\u0642\u0627\u0626\u0642.","\u0623\u0636\u0641 \u0627\u0644\u0632\u0646\u062c\u0628\u064a\u0644 \u0648\u0627\u0644\u062b\u0648\u0645 \u0648\u0627\u0644\u0641\u0644\u0641\u0644 \u0648\u0627\u0637\u0647\u0650 \u0644\u0645\u062f\u0629 \u062f\u0642\u064a\u0642\u062a\u064a\u0646. \u0623\u0636\u0641 \u0627\u0644\u0637\u0645\u0627\u0637\u0645 \u0627\u0644\u0645\u062e\u0644\u0648\u0637\u0629 \u0648\u0627\u0637\u0647\u0650 \u0644\u0645\u062f\u0629 \u062f\u0642\u064a\u0642\u062a\u064a\u0646 \u0623\u062e\u0631\u064a\u064a\u0646.","\u0623\u0636\u0641 \u0627\u0644\u0643\u0632\u0628\u0631\u0629 \u0627\u0644\u0645\u0637\u062d\u0648\u0646\u0629 \u0648\u0627\u0644\u063a\u0631\u0627\u0645 \u0645\u0627\u0633\u0627\u0644\u0627 \u0648\u0628\u0630\u0648\u0631 \u0627\u0644\u0643\u0645\u0648\u0646. \u0623\u0639\u062f \u0627\u0644\u062f\u062c\u0627\u062c \u0648\u0627\u0637\u0647\u0650 \u0644\u0628\u0636\u0639 \u062f\u0642\u0627\u0626\u0642.","\u0623\u0636\u0641 \u0627\u0644\u0641\u0644\u0641\u0644 \u0627\u0644\u0623\u062e\u0636\u0631 \u0648\u0627\u0644\u0645\u0627\u0621 \u0648\u063a\u0637\u0651 \u0648\u0627\u062a\u0631\u0643\u0647 \u064a\u064f\u0637\u0647\u0649 \u0639\u0644\u0649 \u0646\u0627\u0631 \u0647\u0627\u062f\u0626\u0629 \u0644\u0645\u062f\u0629 10-15 \u062f\u0642\u064a\u0642\u0629. \u0631\u0634\u0651 \u0627\u0644\u0643\u0632\u0628\u0631\u0629 \u0627\u0644\u0645\u0641\u0631\u0648\u0645\u0629."],t.s)
B.a8x=new A.c(B.ax,["Chicken jalfrezi","This classic spicy chicken dish with peppers is low in fat and super simple to make.",334,41,8,8,15,"Easy","Dinner",4,0,0,"NHS","https://assets.nhs.uk/campaigns-cms-prod/images/28.-Chicken-Jalfrezi.width-1534.jpg","https://www.nhs.uk/healthier-families/recipes/chicken-jalfrezi/",B.a5m,"\u062c\u0627\u0644\u0641\u0631\u064a\u0632\u064a \u0627\u0644\u062f\u062c\u0627\u062c","\u0637\u0628\u0642 \u062f\u062c\u0627\u062c \u062d\u0627\u0631 \u0643\u0644\u0627\u0633\u064a\u0643\u064a \u0645\u0639 \u0627\u0644\u0641\u0644\u0641\u0644\u060c \u0642\u0644\u064a\u0644 \u0627\u0644\u062f\u0647\u0648\u0646 \u0648\u0633\u0647\u0644 \u0627\u0644\u062a\u062d\u0636\u064a\u0631.",B.a36],t.R)
B.a1Y=s(["Preheat oven to 200C (fan 180C). Lightly grease a baking sheet with vegetable oil.","Put potato wedges into a roasting tin, add oil and toss to coat. Season with pepper and bake for 35-40 minutes, turning after 20 minutes.","Sprinkle breadcrumbs onto a large plate and season. Dip each fish fillet in beaten egg, then coat in breadcrumbs. Place on the baking sheet.","Transfer fish to the oven when you turn the potatoes, cooking for 15-20 minutes. Fish is done when it flakes easily with a fork.","Heat the mushy peas in a saucepan, then serve with the fish and chips."],t.s)
B.a5D=s(["\u0633\u062e\u0651\u0646 \u0627\u0644\u0641\u0631\u0646 \u0639\u0644\u0649 200 \u062f\u0631\u062c\u0629. \u0627\u062f\u0647\u0646 \u0635\u064a\u0646\u064a\u0629 \u062e\u0641\u064a\u0641\u0627\u064b \u0628\u0627\u0644\u0632\u064a\u062a.","\u0636\u0639 \u0623\u0633\u0627\u0641\u064a\u0646 \u0627\u0644\u0628\u0637\u0627\u0637\u0633 \u0641\u064a \u0635\u064a\u0646\u064a\u0629 \u0648\u0623\u0636\u0641 \u0627\u0644\u0632\u064a\u062a \u0648\u0642\u0644\u0651\u0628. \u062a\u0628\u0651\u0644 \u0648\u0627\u062e\u0628\u0632 \u0644\u0645\u062f\u0629 35-40 \u062f\u0642\u064a\u0642\u0629 \u0645\u0639 \u0627\u0644\u062a\u0642\u0644\u064a\u0628 \u0628\u0639\u062f 20 \u062f\u0642\u064a\u0642\u0629.","\u0631\u0634\u0651 \u0641\u062a\u0627\u062a \u0627\u0644\u062e\u0628\u0632 \u0639\u0644\u0649 \u0637\u0628\u0642 \u0648\u062a\u0628\u0651\u0644. \u0627\u063a\u0645\u0633 \u0643\u0644 \u0642\u0637\u0639\u0629 \u0633\u0645\u0643 \u0641\u064a \u0627\u0644\u0628\u064a\u0636 \u0627\u0644\u0645\u062e\u0641\u0648\u0642 \u062b\u0645 \u063a\u0644\u0651\u0641\u0647\u0627 \u0628\u0627\u0644\u0641\u062a\u0627\u062a.","\u0627\u0646\u0642\u0644 \u0627\u0644\u0633\u0645\u0643 \u0644\u0644\u0641\u0631\u0646 \u0639\u0646\u062f\u0645\u0627 \u062a\u0642\u0644\u0628 \u0627\u0644\u0628\u0637\u0627\u0637\u0633 \u0648\u0627\u0637\u0647\u0650\u0647 \u0644\u0645\u062f\u0629 15-20 \u062f\u0642\u064a\u0642\u0629.","\u0633\u062e\u0651\u0646 \u0627\u0644\u0628\u0627\u0632\u0644\u0627\u0621 \u0627\u0644\u0645\u0647\u0631\u0648\u0633\u0629 \u0641\u064a \u0642\u062f\u0631 \u0648\u0642\u062f\u0651\u0645\u0647\u0627 \u0645\u0639 \u0627\u0644\u0633\u0645\u0643 \u0648\u0627\u0644\u0628\u0637\u0627\u0637\u0633."],t.s)
B.a8n=new A.c(B.ax,["Good old fish & chips","Make your own healthier version of fish and chips at home!",402,34,56,6,10,"Medium","Dinner",4,1,0,"NHS","https://assets.nhs.uk/campaigns-cms-prod/images/Recipes-square-healthy-fish-and-chips.width-1534.jpg","https://www.nhs.uk/healthier-families/recipes/homemade-fish-and-chips/",B.a1Y,"\u0633\u0645\u0643 \u0648\u0628\u0637\u0627\u0637\u0633 \u0645\u0642\u0644\u064a\u0629","\u0627\u0635\u0646\u0639 \u0646\u0633\u062e\u062a\u0643 \u0627\u0644\u0635\u062d\u064a\u0629 \u0645\u0646 \u0627\u0644\u0633\u0645\u0643 \u0648\u0627\u0644\u0628\u0637\u0627\u0637\u0633 \u0627\u0644\u0645\u0642\u0644\u064a\u0629 \u0641\u064a \u0627\u0644\u0645\u0646\u0632\u0644!",B.a5D],t.R)
B.a2z=s(["Heat oil in a large non-stick frying pan on medium heat. Add onion, peppers and garlic, cook for about 5 minutes until softened.","Stir in the aubergine and cook for 5 minutes until golden-brown. Add tomatoes, tomato puree, salt, cumin and cayenne. Bring to a boil then simmer for 10 minutes until thickened.","Stir in chickpeas, cover and cook for 5-8 minutes. Stir in chopped spinach and lower heat.","Create 6 wells in the mixture with a wooden spoon and crack an egg into each. Cover and cook for 6-8 minutes on low until egg whites set.","Take off the heat, leave to cool for a few minutes. Scatter with chopped coriander and serve."],t.s)
B.a4p=s(["\u0633\u062e\u0651\u0646 \u0627\u0644\u0632\u064a\u062a \u0641\u064a \u0645\u0642\u0644\u0627\u0629 \u0643\u0628\u064a\u0631\u0629 \u063a\u064a\u0631 \u0644\u0627\u0635\u0642\u0629 \u0639\u0644\u0649 \u0646\u0627\u0631 \u0645\u062a\u0648\u0633\u0637\u0629. \u0623\u0636\u0641 \u0627\u0644\u0628\u0635\u0644 \u0648\u0627\u0644\u0641\u0644\u0641\u0644 \u0648\u0627\u0644\u062b\u0648\u0645 \u0648\u0627\u0637\u0647\u0650 \u0644\u0645\u062f\u0629 5 \u062f\u0642\u0627\u0626\u0642.","\u0623\u0636\u0641 \u0627\u0644\u0628\u0627\u0630\u0646\u062c\u0627\u0646 \u0648\u0627\u0637\u0647\u0650 \u0644\u0645\u062f\u0629 5 \u062f\u0642\u0627\u0626\u0642. \u0623\u0636\u0641 \u0627\u0644\u0637\u0645\u0627\u0637\u0645 \u0648\u0645\u0639\u062c\u0648\u0646 \u0627\u0644\u0637\u0645\u0627\u0637\u0645 \u0648\u0627\u0644\u0645\u0644\u062d \u0648\u0627\u0644\u0643\u0645\u0648\u0646 \u0648\u0627\u0644\u0641\u0644\u0641\u0644 \u0627\u0644\u062d\u0627\u0631. \u0627\u063a\u0644\u0650 \u062b\u0645 \u0627\u062a\u0631\u0643\u0647 \u0639\u0644\u0649 \u0646\u0627\u0631 \u0647\u0627\u062f\u0626\u0629 \u0644\u0645\u062f\u0629 10 \u062f\u0642\u0627\u0626\u0642.","\u0623\u0636\u0641 \u0627\u0644\u062d\u0645\u0635 \u0648\u063a\u0637\u0651 \u0648\u0627\u0637\u0647\u0650 \u0644\u0645\u062f\u0629 5-8 \u062f\u0642\u0627\u0626\u0642. \u0623\u0636\u0641 \u0627\u0644\u0633\u0628\u0627\u0646\u062e \u0648\u062e\u0641\u0651\u0641 \u0627\u0644\u062d\u0631\u0627\u0631\u0629.","\u0627\u0635\u0646\u0639 6 \u062d\u0641\u0631 \u0641\u064a \u0627\u0644\u062e\u0644\u064a\u0637 \u0648\u0627\u0643\u0633\u0631 \u0628\u064a\u0636\u0629 \u0641\u064a \u0643\u0644 \u0648\u0627\u062d\u062f\u0629. \u063a\u0637\u0651 \u0648\u0627\u0637\u0647\u0650 \u0644\u0645\u062f\u0629 6-8 \u062f\u0642\u0627\u0626\u0642 \u0639\u0644\u0649 \u0646\u0627\u0631 \u0647\u0627\u062f\u0626\u0629 \u062d\u062a\u0649 \u064a\u0646\u0636\u062c \u0627\u0644\u0628\u064a\u0627\u0636.","\u0627\u0631\u0641\u0639\u0647 \u0639\u0646 \u0627\u0644\u0646\u0627\u0631 \u0648\u0627\u062a\u0631\u0643\u0647 \u064a\u0628\u0631\u062f \u0642\u0644\u064a\u0644\u0627\u064b. \u0631\u0634\u0651 \u0627\u0644\u0643\u0632\u0628\u0631\u0629 \u0627\u0644\u0645\u0641\u0631\u0648\u0645\u0629 \u0648\u0642\u062f\u0651\u0645."],t.s)
B.a8b=new A.c(B.ax,["Shakshuka","A simple and delicious vegetarian dish of eggs poached in a spicy tomato and vegetable sauce. Perfect for lunch or a light evening meal.",417,25,32,18,15,"Easy","Lunch",4,0,0,"NHS","https://assets.nhs.uk/campaigns-cms-prod/images/23.-Shakshuka-.width-1534.jpg","https://www.nhs.uk/healthier-families/recipes/shakshuka/",B.a2z,"\u0634\u0643\u0634\u0648\u0643\u0629","\u0637\u0628\u0642 \u0646\u0628\u0627\u062a\u064a \u0628\u0633\u064a\u0637 \u0648\u0644\u0630\u064a\u0630 \u0645\u0646 \u0627\u0644\u0628\u064a\u0636 \u0627\u0644\u0645\u0633\u0644\u0648\u0642 \u0641\u064a \u0635\u0644\u0635\u0629 \u0637\u0645\u0627\u0637\u0645 \u062d\u0627\u0631\u0629. \u0645\u062b\u0627\u0644\u064a \u0644\u0644\u063a\u062f\u0627\u0621 \u0623\u0648 \u0639\u0634\u0627\u0621 \u062e\u0641\u064a\u0641.",B.a4p],t.R)
B.a31=s(["Cook potatoes in boiling water for about 20 minutes until tender.","While potatoes cook, brown the minced beef a handful at a time in a large saucepan.","Stir in onion, carrot, courgette, green beans and mixed herbs. Add 450ml water, bring to the boil and simmer for 20 minutes until veg has softened.","Drain and mash the potatoes with some pepper.","Add sweetcorn to the mince, sprinkle in gravy granules and stir until thickened. Tip into a baking dish.","Spoon mash on top, spreading to cover the mince. Pop under a preheated grill until browned. Leave to cool slightly before serving."],t.s)
B.a2S=s(["\u0627\u0637\u0647\u0650 \u0627\u0644\u0628\u0637\u0627\u0637\u0633 \u0641\u064a \u0645\u0627\u0621 \u0645\u063a\u0644\u064a \u0644\u0645\u062f\u0629 20 \u062f\u0642\u064a\u0642\u0629 \u062d\u062a\u0649 \u062a\u0644\u064a\u0646.","\u0623\u062b\u0646\u0627\u0621 \u0630\u0644\u0643\u060c \u062d\u0645\u0651\u0631 \u0627\u0644\u0644\u062d\u0645 \u0627\u0644\u0645\u0641\u0631\u0648\u0645 \u0639\u0644\u0649 \u062f\u0641\u0639\u0627\u062a \u0641\u064a \u0642\u062f\u0631 \u0643\u0628\u064a\u0631.","\u0623\u0636\u0641 \u0627\u0644\u0628\u0635\u0644 \u0648\u0627\u0644\u062c\u0632\u0631 \u0648\u0627\u0644\u0643\u0648\u0633\u0627 \u0648\u0627\u0644\u0641\u0627\u0635\u0648\u0644\u064a\u0627 \u0627\u0644\u062e\u0636\u0631\u0627\u0621 \u0648\u0627\u0644\u0623\u0639\u0634\u0627\u0628. \u0623\u0636\u0641 450 \u0645\u0644 \u0645\u0627\u0621 \u0648\u0627\u063a\u0644\u0650 \u0648\u0627\u062a\u0631\u0643\u0647 20 \u062f\u0642\u064a\u0642\u0629 \u062d\u062a\u0649 \u062a\u0644\u064a\u0646 \u0627\u0644\u062e\u0636\u0627\u0631.","\u0635\u0641\u0651 \u0648\u0627\u0647\u0631\u0633 \u0627\u0644\u0628\u0637\u0627\u0637\u0633 \u0645\u0639 \u0627\u0644\u0641\u0644\u0641\u0644.","\u0623\u0636\u0641 \u0627\u0644\u0630\u0631\u0629 \u0644\u0644\u062d\u0645 \u0648\u0631\u0634\u0651 \u062d\u0628\u064a\u0628\u0627\u062a \u0627\u0644\u0645\u0631\u0642 \u0648\u062d\u0631\u0651\u0643 \u062d\u062a\u0649 \u064a\u062a\u0643\u0627\u062b\u0641. \u0627\u0633\u0643\u0628 \u0641\u064a \u0637\u0628\u0642 \u0641\u0631\u0646.","\u0648\u0632\u0651\u0639 \u0627\u0644\u0628\u0637\u0627\u0637\u0633 \u0627\u0644\u0645\u0647\u0631\u0648\u0633\u0629 \u0641\u0648\u0642\u0647\u0627. \u0636\u0639\u0647\u0627 \u062a\u062d\u062a \u0627\u0644\u0634\u0648\u0627\u064a\u0629 \u062d\u062a\u0649 \u062a\u062d\u0645\u0631\u0651. \u0627\u062a\u0631\u0643\u0647\u0627 \u062a\u0628\u0631\u062f \u0642\u0644\u064a\u0644\u0627\u064b \u0642\u0628\u0644 \u0627\u0644\u062a\u0642\u062f\u064a\u0645."],t.s)
B.a8z=new A.c(B.ax,["Classic cottage pie","This comforting pie, topped with mash rather than pastry, is made with lean mince and extra veg for a healthy twist on a family favourite.",363,26,50,5,15,"Medium","Dinner",4,0,0,"NHS","https://assets.nhs.uk/campaigns-cms-prod/images/Classic_cottage_pie_PbLklZn.width-1534.png","https://www.nhs.uk/healthier-families/recipes/classic-cottage-pie/",B.a31,"\u0641\u0637\u064a\u0631\u0629 \u0627\u0644\u0643\u0648\u062e \u0627\u0644\u0643\u0644\u0627\u0633\u064a\u0643\u064a\u0629","\u0641\u0637\u064a\u0631\u0629 \u0645\u0631\u064a\u062d\u0629 \u0628\u062a\u063a\u0637\u064a\u0629 \u0627\u0644\u0628\u0637\u0627\u0637\u0633 \u0627\u0644\u0645\u0647\u0631\u0648\u0633\u0629 \u0628\u062f\u0644 \u0627\u0644\u0639\u062c\u064a\u0646\u060c \u0645\u0639 \u0644\u062d\u0645 \u0645\u0641\u0631\u0648\u0645 \u0642\u0644\u064a\u0644 \u0627\u0644\u062f\u0647\u0648\u0646 \u0648\u062e\u0636\u0627\u0631 \u0625\u0636\u0627\u0641\u064a\u0629.",B.a2S],t.R)
B.a4G=s(["Heat oil in a large frying pan. Cook spring onions over medium-high heat for a few seconds. Turn heat down, add rice and fry for about a minute until glossy.","Add garlic and mushrooms, cook for a minute. Pour in about half the hot stock and stir well.","Cook over medium heat for 20-25 minutes, stirring often and slowly adding remaining stock a little at a time, until rice has soaked up all the liquid.","Check rice is tender with a nice creamy texture. Add peas, stir gently and cook for another couple of minutes. Season and serve."],t.s)
B.a5s=s(["\u0633\u062e\u0651\u0646 \u0627\u0644\u0632\u064a\u062a \u0641\u064a \u0645\u0642\u0644\u0627\u0629 \u0643\u0628\u064a\u0631\u0629. \u0627\u0637\u0647\u0650 \u0627\u0644\u0628\u0635\u0644 \u0627\u0644\u0623\u062e\u0636\u0631 \u0639\u0644\u0649 \u0646\u0627\u0631 \u0645\u062a\u0648\u0633\u0637\u0629-\u0639\u0627\u0644\u064a\u0629 \u0644\u0628\u0636\u0639 \u062b\u0648\u0627\u0646\u064d. \u062e\u0641\u0651\u0641 \u0627\u0644\u062d\u0631\u0627\u0631\u0629 \u0648\u0623\u0636\u0641 \u0627\u0644\u0623\u0631\u0632 \u0648\u062d\u0645\u0651\u0631\u0647 \u0644\u0645\u062f\u0629 \u062f\u0642\u064a\u0642\u0629.","\u0623\u0636\u0641 \u0627\u0644\u062b\u0648\u0645 \u0648\u0627\u0644\u0641\u0637\u0631 \u0648\u0627\u0637\u0647\u0650 \u0644\u0645\u062f\u0629 \u062f\u0642\u064a\u0642\u0629. \u0627\u0633\u0643\u0628 \u0646\u0635\u0641 \u0627\u0644\u0645\u0631\u0642 \u0627\u0644\u0633\u0627\u062e\u0646 \u0648\u062d\u0631\u0651\u0643 \u062c\u064a\u062f\u0627\u064b.","\u0627\u0637\u0647\u0650 \u0639\u0644\u0649 \u0646\u0627\u0631 \u0645\u062a\u0648\u0633\u0637\u0629 \u0644\u0645\u062f\u0629 20-25 \u062f\u0642\u064a\u0642\u0629 \u0645\u0639 \u0627\u0644\u062a\u062d\u0631\u064a\u0643 \u0627\u0644\u0645\u062a\u0643\u0631\u0631 \u0648\u0625\u0636\u0627\u0641\u0629 \u0627\u0644\u0645\u0631\u0642 \u0627\u0644\u0645\u062a\u0628\u0642\u064a \u062a\u062f\u0631\u064a\u062c\u064a\u0627\u064b.","\u062a\u0623\u0643\u062f \u0623\u0646 \u0627\u0644\u0623\u0631\u0632 \u0637\u0631\u064a \u0648\u0643\u0631\u064a\u0645\u064a. \u0623\u0636\u0641 \u0627\u0644\u0628\u0627\u0632\u0644\u0627\u0621 \u0648\u062d\u0631\u0651\u0643 \u0648\u0627\u0637\u0647\u0650 \u0644\u062f\u0642\u064a\u0642\u062a\u064a\u0646 \u0625\u0636\u0627\u0641\u064a\u062a\u064a\u0646. \u062a\u0628\u0651\u0644 \u0648\u0642\u062f\u0651\u0645."],t.s)
B.a8f=new A.c(B.ax,["Mushroom risotto","A real comfort classic, risotto is much easier to make than you might think. All you need is the right rice and a bit of patience!",317,9,64,2,15,"Medium","Dinner",4,0,0,"NHS","https://assets.nhs.uk/campaigns-cms-prod/images/Mushroom_risotto_JWslYeN.width-1534.png","https://www.nhs.uk/healthier-families/recipes/mushroom-risotto/",B.a4G,"\u0631\u064a\u0632\u0648\u062a\u0648 \u0627\u0644\u0641\u0637\u0631","\u0643\u0644\u0627\u0633\u064a\u0643\u064a\u0629 \u0645\u0631\u064a\u062d\u0629 \u062d\u0642\u064a\u0642\u064a\u0629\u060c \u0627\u0644\u0631\u064a\u0632\u0648\u062a\u0648 \u0623\u0633\u0647\u0644 \u0645\u0645\u0627 \u062a\u0639\u062a\u0642\u062f. \u0643\u0644 \u0645\u0627 \u062a\u062d\u062a\u0627\u062c\u0647 \u0647\u0648 \u0627\u0644\u0623\u0631\u0632 \u0627\u0644\u0635\u062d\u064a\u062d \u0648\u0642\u0644\u064a\u0644 \u0645\u0646 \u0627\u0644\u0635\u0628\u0631!",B.a5s],t.R)
B.a6_=s(["Put brown rice on to cook in plenty of boiling water for 30 minutes, or until tender.","Drain pineapple juice into a bowl, cut pineapple rings into chunks. Add cornflour to juice and stir smooth, then mix in tomato puree and soy sauce.","When rice is 10 minutes from ready, heat oil in a wok. Add chicken and stir-fry over high heat for 3-4 minutes.","Add onion, pepper and celery. Stir-fry for 3-4 minutes, then add tomato wedges and pineapple chunks.","Give the sauce a quick stir, pour into the pan. Stir until hot and thickened. Season and serve with drained rice."],t.s)
B.a6x=s(["\u0636\u0639 \u0627\u0644\u0623\u0631\u0632 \u0627\u0644\u0628\u0646\u064a \u064a\u064f\u0637\u0647\u0649 \u0641\u064a \u0645\u0627\u0621 \u0645\u063a\u0644\u064a \u0644\u0645\u062f\u0629 30 \u062f\u0642\u064a\u0642\u0629.","\u0635\u0641\u0651 \u0639\u0635\u064a\u0631 \u0627\u0644\u0623\u0646\u0627\u0646\u0627\u0633 \u0641\u064a \u0648\u0639\u0627\u0621 \u0648\u0642\u0637\u0651\u0639 \u0627\u0644\u062d\u0644\u0642\u0627\u062a. \u0623\u0636\u0641 \u0646\u0634\u0627 \u0627\u0644\u0630\u0631\u0629 \u0644\u0644\u0639\u0635\u064a\u0631 \u0648\u062d\u0631\u0651\u0643 \u062d\u062a\u0649 \u064a\u0646\u0639\u0645\u060c \u062b\u0645 \u0623\u0636\u0641 \u0645\u0639\u062c\u0648\u0646 \u0627\u0644\u0637\u0645\u0627\u0637\u0645 \u0648\u0635\u0644\u0635\u0629 \u0627\u0644\u0635\u0648\u064a\u0627.","\u0642\u0628\u0644 10 \u062f\u0642\u0627\u0626\u0642 \u0645\u0646 \u0646\u0636\u062c \u0627\u0644\u0623\u0631\u0632\u060c \u0633\u062e\u0651\u0646 \u0627\u0644\u0632\u064a\u062a \u0641\u064a \u0627\u0644\u0648\u0648\u0643. \u0623\u0636\u0641 \u0627\u0644\u062f\u062c\u0627\u062c \u0648\u0642\u0644\u0651\u0628 \u0639\u0644\u0649 \u0646\u0627\u0631 \u0639\u0627\u0644\u064a\u0629 \u0644\u0645\u062f\u0629 3-4 \u062f\u0642\u0627\u0626\u0642.","\u0623\u0636\u0641 \u0627\u0644\u0628\u0635\u0644 \u0648\u0627\u0644\u0641\u0644\u0641\u0644 \u0648\u0627\u0644\u0643\u0631\u0641\u0633. \u0642\u0644\u0651\u0628 \u0644\u0645\u062f\u0629 3-4 \u062f\u0642\u0627\u0626\u0642 \u062b\u0645 \u0623\u0636\u0641 \u0634\u0631\u0627\u0626\u062d \u0627\u0644\u0637\u0645\u0627\u0637\u0645 \u0648\u0642\u0637\u0639 \u0627\u0644\u0623\u0646\u0627\u0646\u0627\u0633.","\u062d\u0631\u0651\u0643 \u0627\u0644\u0635\u0644\u0635\u0629 \u0648\u0627\u0633\u0643\u0628\u0647\u0627 \u0641\u064a \u0627\u0644\u0645\u0642\u0644\u0627\u0629. \u062d\u0631\u0651\u0643 \u062d\u062a\u0649 \u062a\u0633\u062e\u0646 \u0648\u062a\u062a\u0643\u0627\u062b\u0641. \u062a\u0628\u0651\u0644 \u0648\u0642\u062f\u0651\u0645 \u0645\u0639 \u0627\u0644\u0623\u0631\u0632 \u0627\u0644\u0645\u0635\u0641\u0649."],t.s)
B.a8y=new A.c(B.ax,["Sweet & sour chicken","The whole family will love this healthier spin on a takeaway classic!",295,21,45,5,20,"Medium","Dinner",4,0,0,"NHS","https://assets.nhs.uk/campaigns-cms-prod/images/Sweet_and_sour_chicken_JI3Z767.width-1534.png","https://www.nhs.uk/healthier-families/recipes/sweet-and-sour-chicken/",B.a6_,"\u062f\u062c\u0627\u062c \u062d\u0644\u0648 \u0648\u062d\u0627\u0645\u0636","\u0633\u062a\u062d\u0628 \u0627\u0644\u0639\u0627\u0626\u0644\u0629 \u0643\u0644\u0647\u0627 \u0647\u0630\u0647 \u0627\u0644\u0646\u0633\u062e\u0629 \u0627\u0644\u0635\u062d\u064a\u0629 \u0645\u0646 \u0627\u0644\u0648\u062c\u0628\u0627\u062a \u0627\u0644\u062c\u0627\u0647\u0632\u0629 \u0627\u0644\u0643\u0644\u0627\u0633\u064a\u0643\u064a\u0629!",B.a6x],t.R)
B.a6s=s(["Cook rice in simmering water for 12-15 minutes until tender. Drain well.","Heat oil in a large non-stick frying pan and cook onion and celery for 3-4 minutes until softened.","Add green pepper, mushrooms, tomatoes and prawns. Stir-fry for another 4 minutes.","Stir in the hot cooked rice, parsley, Cajun seasoning and chilli powder. Cook for 2 more minutes until heated through.","Season to taste and serve at once."],t.s)
B.a0E=s(["\u0627\u0637\u0647\u0650 \u0627\u0644\u0623\u0631\u0632 \u0641\u064a \u0645\u0627\u0621 \u064a\u063a\u0644\u064a \u0628\u0631\u0641\u0642 \u0644\u0645\u062f\u0629 12-15 \u062f\u0642\u064a\u0642\u0629 \u062d\u062a\u0649 \u064a\u0644\u064a\u0646. \u0635\u0641\u0651\u0647 \u062c\u064a\u062f\u0627\u064b.","\u0633\u062e\u0651\u0646 \u0627\u0644\u0632\u064a\u062a \u0641\u064a \u0645\u0642\u0644\u0627\u0629 \u0643\u0628\u064a\u0631\u0629 \u063a\u064a\u0631 \u0644\u0627\u0635\u0642\u0629 \u0648\u0627\u0637\u0647\u0650 \u0627\u0644\u0628\u0635\u0644 \u0648\u0627\u0644\u0643\u0631\u0641\u0633 \u0644\u0645\u062f\u0629 3-4 \u062f\u0642\u0627\u0626\u0642.","\u0623\u0636\u0641 \u0627\u0644\u0641\u0644\u0641\u0644 \u0627\u0644\u0623\u062e\u0636\u0631 \u0648\u0627\u0644\u0641\u0637\u0631 \u0648\u0627\u0644\u0637\u0645\u0627\u0637\u0645 \u0648\u0627\u0644\u0631\u0648\u0628\u064a\u0627\u0646. \u0642\u0644\u0651\u0628 \u0644\u0645\u062f\u0629 4 \u062f\u0642\u0627\u0626\u0642 \u0623\u062e\u0631\u0649.","\u0623\u0636\u0641 \u0627\u0644\u0623\u0631\u0632 \u0627\u0644\u0633\u0627\u062e\u0646 \u0627\u0644\u0645\u0637\u0647\u0648 \u0648\u0627\u0644\u0628\u0642\u062f\u0648\u0646\u0633 \u0648\u062a\u0648\u0627\u0628\u0644 \u0627\u0644\u0643\u0627\u062c\u0648\u0646 \u0648\u0645\u0633\u062d\u0648\u0642 \u0627\u0644\u0641\u0644\u0641\u0644 \u0627\u0644\u062d\u0627\u0631. \u0627\u0637\u0647\u0650 \u0644\u0645\u062f\u0629 \u062f\u0642\u064a\u0642\u062a\u064a\u0646 \u0625\u0636\u0627\u0641\u064a\u062a\u064a\u0646.","\u062a\u0628\u0651\u0644 \u062d\u0633\u0628 \u0627\u0644\u0630\u0648\u0642 \u0648\u0642\u062f\u0651\u0645 \u0641\u0648\u0631\u0627\u064b."],t.s)
B.a8B=new A.c(B.ax,["Prawn jambalaya","This healthy, easy-to-make prawn dish will satisfy the whole family.",342,18,59,3,15,"Easy","Dinner",4,0,0,"NHS","https://assets.nhs.uk/campaigns-cms-prod/images/Prawn_jambalaya.width-1534.png","https://www.nhs.uk/healthier-families/recipes/prawn-jambalaya/",B.a6s,"\u062c\u0627\u0645\u0628\u0627\u0644\u0627\u064a\u0627 \u0627\u0644\u0631\u0648\u0628\u064a\u0627\u0646","\u0637\u0628\u0642 \u0631\u0648\u0628\u064a\u0627\u0646 \u0635\u062d\u064a \u0648\u0633\u0647\u0644 \u0627\u0644\u062a\u062d\u0636\u064a\u0631 \u0633\u064a\u0631\u0636\u064a \u0627\u0644\u0639\u0627\u0626\u0644\u0629 \u0643\u0644\u0647\u0627.",B.a0E],t.R)
B.a41=s(["Boil potatoes for 15-20 minutes until tender, then drain and mash with 2 tablespoons of milk.","Preheat oven to 200C. Put remaining milk, low-fat spread and flour into a saucepan. Bring to the boil, stirring continuously until the sauce thickens.","Stir in parsley and peas, season with pepper. Turn off the heat.","Place chunks of fish in an ovenproof dish. Pour the sauce over, then spoon mashed potato on top.","Sprinkle cheese over the whole dish and bake for 25-30 minutes until golden brown. Serve with steamed greens."],t.s)
